import React from "react";

import Header from './Header'
import Footer from './Footer'

import Banner from "./Banner"
import Intro from "./Intro";
import SecondIntro from "./SecondIntro"

function App() {
  return (
  <div>
  <Header/>
    <body>
    <Banner />
    <Intro />
    <SecondIntro />
    </body>
    <Footer/>
    </div>
  );
}

export default App;
